    "sand-lake-national-wildlife-refuge-narrative-report-january-1-1946-to-april-31-1946",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Sand Lake NWR
    and the easement refuges outlines Refuge accomplishments from January through April
    of 1946. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, mammals, raptors, and fish- is also
    covered. The Refuge development and maintenance section discusses physical developments.
    Resource management is outlined; topics include fur harvesting. The public relations
    section of the report describes Refuge visitors and Refuge participation. N-R forms
    are attached.",nt"license_title": "License Not Specified",nt"extras":
